css:
@-moz-document url-prefix("http://www.tumblr.com/"), url-prefix('https://www.tumblr.com/')   {
body {
   background:url("http://i40.tinypic.com/64hugy.png") no-repeat fixed !important;
   background-color: #ffffff !important;
   background-position: center !important;
   background-size: cover  !important;
 }

#logo {
height: 45px !important;
width: 196px !important;
}

#logo > .logo_anchor {
background: url('http://i.imgur.com/8Z3aNvK.png') no-repeat !important;
}


div.l-header .tab.iconic > a {
background-image: url('http://i.imgur.com/SaEjU3c.png') !important;
}

div.l-header .tab.iconic>a {
opacity: .6;
}

#xkit-control > a {
background-image: url('http://i.imgur.com/jtY44KR.png') !important;
}

#left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {  
   font-family: Arial; color: #222 !important; 
   background: rgba(50, 50, 50, .4) !important;
}

.mceContentBody {background: white !important}

.controls_section li .posts:before {

  position: absolute !important;
  height: 30px !important;
  line-height: 28px !important;
  width: 100px !important;
  font: inherit !important;
}

.post_permalink {
background: url('http://i.imgur.com/DSITYKs.png') !important;
width: 17px !important;
height: 17px !important;
display: inline !important;
}

.post_permalink:hover {
background: url('http://i.imgur.com/x38ZTAS.png') !important;
width: 17px !important;
height: 17px !important;
display: inline !important;
}

.plexi.color {
background: rgba(100, 100, 100, 0.7) !important;
  }

#right_column .controls_section li a,

#right_column .controls_section li a .count {

  color: #e6e6e6 !important; 
}

#right_column {
  background-color: rgba(100, 100, 100, 0) !important;
}

div#right_column:after {
  background: none !important;
}

.selection_nipple.white, .selection_nipple:not([class="selection_nipple white"]) {
background: none !important;
width: 0px !important;
height: 0px !important;
margin-top: 0px !important;
border-bottom: solid 11px rgba(0, 0, 0, 0.4) !important;
border-right: 11px solid transparent !important;
border-left: 11px solid transparent !important;
}

.link_button {
  	min-height:130px;
    border-radius:3px;
    border:none !important;
    background-color:#fff;
    -webkit-box-sizing:border-box;
    -moz-box-sizing:border-box;
    box-sizing:border-box;
    opacity:1;
    -webkit-transition:opacity .25s linear;
    -moz-transition:opacity .25s linear;
    -ms-transition:opacity .25s linear;
    -o-transition:opacity .25s linear;
    transition:opacity .25s linear
}
.link_button .link_title {
  	color:#333;
	font-size:34px;
    line-height:36px;
	font-weight:none!important;
}
.link_button .link_source {
  color:#333;
}

.open_blog { 
line-height: 30px !important;
height: 30px !Important;
}

.blog_menu .selected_blog #open_blog_link {
font-family: Arial !important;
font-size: inherit !important;
}

.controls_section li.section_header {
border-bottom: transparent !important;
display: none !important;
}

.search_form_row {
background-color: rgba(0,0,0,.3) !important;
}

#pagination a {
background-color: transparent !important;
color: #e6e6e6 !important;
}

#dashboard_controls a, #dashboard_controls .control {
color: #e6e6e6 !important;
text-shadow: none;
}

.footer_links a {
color: #e6e6e6 !important
}
}
